" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Frontal chest radiography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 469px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A frontal chest radiograph on a 45-year-old woman with recurrent left hemothorax secondary to metastatic leiomyosarcoma of the uterus. There is a large collection of blood (verified by pleural tap) in the left hemithorax with displacement of mediastinal structures to the right. After embolization, she improved clinically with less accumulation of blood in the left hemithorax.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Angiogram",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 405px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
