var title_f0_40_652="Approach to mediastinal nodes";
var content_f0_40_652=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59333&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59333&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Anatomic considerations in TBNA of mediastinal lymph nodes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Station",
"      </td>",
"      <td class=\"subtitle1\">",
"       Level",
"      </td>",
"      <td class=\"subtitle1\">",
"       Best approach",
"      </td>",
"      <td class=\"subtitle1\">",
"       Pitfalls",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       7",
"      </td>",
"      <td>",
"       Subcarinal nodes",
"      </td>",
"      <td>",
"       From a point 3-5 mm below on either side of the primary carina, with the needle pointed in an inferomedial direction.",
"      </td>",
"      <td>",
"       Direct puncture of a normal looking carina should usually be avoided.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4R",
"      </td>",
"      <td>",
"       Right paratracheal lymph nodes",
"      </td>",
"      <td>",
"       From the second or third intercartilaginous space (or 2 cm) proximal to the carina at the 1-2 o'clock position.",
"      </td>",
"      <td>",
"       The mediastinal reflection of the pleura and the azygos vein lie at the 3 o'clock position and should be avoided.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4L",
"      </td>",
"      <td>",
"       Left paratracheal nodes",
"      </td>",
"      <td>",
"       From the lateral wall of the left main bronchus at the level of the carina at the 9 o'clock position.",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       10R",
"      </td>",
"      <td>",
"       Right hilar nodes",
"      </td>",
"      <td>",
"       Through the bronchus intermedius at 3 o'clock position, just below the level of the right upper lobe bronchus or proximal to the origin of the superior segment of the right lower lobe bronchus.",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       10L",
"      </td>",
"      <td>",
"       Left hilar nodes",
"      </td>",
"      <td>",
"       At the origin of the left lower lobe bronchus at the nine o'clock position.",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from Minai, OA, Dasgupta, A, Mehta, AC. Transbronchial needle aspiration of central and peripheral lesions. In: Bolliger, CT, Mathur, PN (Eds), Progress in Respiratory Research - Interventional Bronchoscopy. Karger, Basel, Switzerland, 1999.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
