var title_f0_40_653="Laboratory testing for PHHI";
var content_f0_40_653=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F64643&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F64643&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Laboratory testing for persistent hyperinsulinemic hypoglycemia of infancy (samples taken during period of hypoglycemia)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Result suggestive of PHHI",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Blood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Glucose",
"       </td>",
"       <td class=\"centered\">",
"        &darr;",
"       </td>",
"       <td>",
"        &lt;40 mg/dL (2.2 mmol/L)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Insulin",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td>",
"        &ge;5 mcU/mL (36 pmol/L)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C-peptide",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td>",
"        &ge;0.2 nmol/L (0.6 ng/mL)",
"       </td>",
"       <td>",
"        If C-peptide is low despite hyperinsulinemia, the possibility of exogenous administration of insulin should be considered",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Free fatty acids",
"       </td>",
"       <td class=\"centered\">",
"        &darr;",
"       </td>",
"       <td>",
"        &lt;1.0 mmol/L",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Beta-hydroxybutyrate",
"       </td>",
"       <td class=\"centered\">",
"        &darr;",
"       </td>",
"       <td>",
"        &lt;1.5 mmol/L",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lactic acid",
"       </td>",
"       <td class=\"centered\">",
"        Normal",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Carnitine",
"       </td>",
"       <td class=\"centered\">",
"        Normal",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ammonia",
"       </td>",
"       <td class=\"centered\">",
"        &uarr; in HIHA form of PHHI",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Normal in other forms of PHHI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Growth hormone",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td>",
"        Usually &gt;10 mcg/L",
"       </td>",
"       <td>",
"        Elevated due to hypoglycemia; this result excludes growth hormone deficiency as a cause of hypoglycemia. However, a normal or low value is NOT diagnostic of growth hormone deficiency.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cortisol",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Elevated due to hypoglycemia; this result excludes cortisol deficiency as a cause of hypoglycemia. However, a normal or low value is NOT diagnostic of cortisol deficiency.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Urine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ketones",
"       </td>",
"       <td class=\"centered\">",
"        Negative",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        In some cases of PHHI, ketonuria may be present despite an abnormally low plasma concentration of ketones, because the renal threshold for ketones is low",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C-peptide",
"       </td>",
"       <td class=\"centered\">",
"        &uarr;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PHHI: persistent hyperinsulinemic hypoglycemia of infancy; HIHA: hyperinsulinism-hyperammonemia.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
